import React from "react";
import logo from '../Assests/'
import { NavLink } from "react-router-dom";
import  '../Navbar/navbar.css'
function Navbar(){
    return(
        <>
        <div className="navbar">
            <div className="logo">
                <img src={logo} alt="logoImage" />
            </div>
                <ul>
                    <li><NavLink to="/" className="nava">home</NavLink></li>
                    <li><NavLink to="/jobes" className="nava">jobes</NavLink></li>
                    <li><NavLink to="/aboutus" className="nava">About us</NavLink></li>
                    <li><NavLink to="/contactus" className="nava">contact us</NavLink></li>
                </ul>
        </div>
        </>
    )
}

export default Navbar;
